 import product_cart from "../data/product_data";
import Box from '@mui/material/Box';
import './mainproduct.css';
import * as React from 'react';
import Grid from '@mui/material/Grid';
import FormLabel from '@mui/material/FormLabel';
import FormControl from '@mui/material/FormControl';
import FormControlLabel from '@mui/material/FormControlLabel';
import RadioGroup from '@mui/material/RadioGroup';
import Radio from '@mui/material/Radio';
import Paper from '@mui/material/Paper';
const listItem=product_cart.map((item)=>

<Box className="cart">
<img src={item.thumb} alt="Logo" style={{ height: '40%',width:'25%', margin: '10px', flexGrow: 2 }} />
<div className="h3">
<h3>{item.name}</h3>
</div>
<div className="description">
<p>{item.description}</p>
</div>
<p className="price">{item.real_price}</p>



</Box>
 );


const Mainproduct = () => {
  const [spacing, setSpacing] = React.useState(2);
  
    const handleChange = (event) => {
      setSpacing(Number(event.target.value));
    };
  
    const jsx = `
  <Grid container spacing={${spacing}}>
  `;
  
  
  const listItem=product_cart.map((item)=>

      <Grid sx={{ flexGrow: 1 ,backgroundColor:"red"}} container spacing={2}>
        <Grid item xs={12} sx={{backgroundColor:"blue"}}>
          <Grid container justifyContent="center" spacing={spacing}>
            {[0, 1, 2,3].map((value) => (
              <Grid key={value} item>
                <Paper
                  sx={{
                    height: 300,
                    width: 200,
                    backgroundColor: (theme) =>
                      theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
                  }}
                /> 
              </Grid>
            ))}
          </Grid>
        </Grid>
        
      </Grid>
    








                    );

return(
<Box> 
 {listItem}
</Box>

);
}
export default Mainproduct;
